INSERT INTO `article` VALUES (23,31,'为什么订单审核失败？',0,'','','答：若您填写的个人资料不完整不真实、上传的照片模糊、有遮挡、综合评分不足等，均会导致失败。',99,''),(24,31,'审核会失败？信用评分不足吗？',0,'','','答：若您填写的个人资料不完整不真实、上传的照片模糊、有遮挡等均会导致审核失败。\r\n',99,''),(25,31,'审核要多久？怎么加快审核进度？',0,'','','答：订单审核时间一般为2-48小时，如遇节假日或申请人数过多，审核进度可能会有延迟。请您保持手机畅通，以便审核人员联系您。您也可以登录APP，进入“借款记录”查看审核进度。\r\n',99,''),(26,31,'订单审核通过后，款项什么时候到账？',0,'','','答：订单审核通过后，预计工作日内最快2个小时打款到您绑定的银行卡中。届时会以短信形式通知您，请注意查收。',99,''),(27,31,'支持哪几家银行卡服务？	',0,'\r','','答：目前支持以下银行的储蓄卡：中国银行、农业银行、工商银行、建设银行、邮储银行、招商银行、民生银行、光大银行、兴业银行、中信银行、平安银行、浦发银行、华夏银行、广发银行。',99,''),(28,31,'绑定银行卡为什么会失败？',0,'\r','','答：请您确认绑定的银行卡为申请人本人所有，且银行卡的相关信息确认无误。若银行卡信息有误，请您联系相关银行进行核实。',99,''),(29,31,'我怎么进行还款？',0,'','','答：我平台将会在您的还款日提醒您还款，您也可以在每月的还款日前，登录我平台APP，进入“个人中心-我的还款”，主动进行还款。\r\n',99,''),(30,31,'没有及时还款会怎样？',0,'\r','','答：若您发生逾期，从逾期首日起会按照合同收取当期应还款项的1%滞纳金作为处罚。同时，您的逾期记录将进入个人征信机构，影响您日后的个人信用记录。请您及时按期还款，感谢您对我平台的关注。',99,''),(32,29,'申请人需要具备什么条件？',1500667106,NULL,'','答： 1、年龄19(含)-58(含)周岁；\r\n2、持有二代身份证；\r\n3、手机号码实名认证；\r\n 感谢您对我平台的关注。',99,''),(33,29,'为什么我有额度，不能借款？',1500667150,NULL,'','答：APP显示的额度是您可以使用的最大额度，但是提交申请之后是需要经过审核的，是否通过以审核结果为准。感谢您对我平台的关注。',99,''),(34,29,'我能申请多少金额？分多少期？',1500667232,NULL,'申请','答：本平台是服务于年轻人的短期信用借款。最低可申请1000元，最高可申请5000元，具体下款及期限以工作人员审核结果为准。感谢您对本平台的关注。',99,''),(35,31,'有哪些支付方式？',1531570385,NULL,'','本平台目前支持支付宝在线支付，请提前绑定储蓄卡或者信用卡！',99,''),(36,29,'关于放款时间的说明。',1531790466,NULL,'','您好，我们申请客户较多，所以贷款进度比较缓慢，请您耐心等待，不要着急，平台会在审核后三到七个工作日陆续放款到账，请留意银行卡信息。',99,'');
